from std/strutils import `%`

const getErrorPage* = """<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>$2 | $3 &mdash; $1</title>
    <style>
        :root {
            --madam-ff: system-ui,-apple-system,"Segoe UI",Roboto,"Helvetica Neue",Arial,"Noto Sans","Liberation Sans",sans-serif,"Apple Color Emoji","Segoe UI Emoji","Segoe UI Symbol","Noto Color Emoji";
            --madam-fs: 1.2rem;
        }
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
        }
    </style>
</head>
<body style="background-color: whitesmoke; font-family: var(--madam-ff); font-size: var(--madam-fs);">
    <div class="container" style="display: flex; height: 100vh; align-items: center;">
        <h2 style="font-weight: 400; width: 100%; text-align: center;">$2 | $3 &mdash; Madam</h2>
    </div>
</body>
</html>""" % ["Madam", "404", "Not Found"]

const getWelcomeScreen* = """<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>$1</title>
    <style>
        :root {
            --madam-ff: system-ui,-apple-system,"Segoe UI",Roboto,"Helvetica Neue",Arial,"Noto Sans","Liberation Sans",sans-serif,"Apple Color Emoji","Segoe UI Emoji","Segoe UI Symbol","Noto Color Emoji";
            --madam-fs: 1.2rem;
        }
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
        }

        .logo {
            margin:auto;
            background-repeat: no-repeat;
            background-image: url('data:image/png;base64,');
            background-size: cover;
            width: 140px;
            height: 140px;
            display: block;
        }
        .row {
            display: flex;
            flex-wrap: wrap;
        }

        .col {    
            flex: 0 0 auto;
            width: 100%;
        }

        a {
            color: blueviolet;
            text-decoration: none;
            font-weight: 600;
        }

        h1 {
            margin-bottom: 10*px;
        }

        code {
            background-color: deeppink;
            color: whitesmoke;
            display: inline-block;
            padding: 0 2px;
            border-radius: 4px;
        }
        p {
            line-height: 1.4em;
        }
    </style>
</head>
<body style="font-family: var(--madam-ff); font-size: var(--madam-fs);">
    <div class="container">
        <div class="row" style="height: 100vh; align-items: center;">
            <div class="col">
                <div class="logo"></div>
                <h1 class="headline" style="text-align: center">Pew pew pew!</h1>
                <p style="text-align: center">🧐 Looks like you haven't created an <code>index.html</code> view, yet.</p>
                <p style="text-align: center">Need help? 👉 Check <a href="https://github.com/openpeep/madam" target="_blank">Madam on GitHub</a></p>

                <p style="text-align: center; line-height:normal"><br><small>Released under <code>MIT</code> license.<br>Developed by <a href="https://github.com/openpeep">Humans from OpenPeep.</a></small></p>
            </div>
        </div>
    </div>
    <script>
    const randmize = function(items) {
        return items[ Math.floor(Math.random()*items.length) ]
    }
    let colors = ["pink", "peachpuff", "antiquewhite", "beige", "bisque", "blanchedalmond", "gainsboro"];
    document.body.style.backgroundColor = randmize(colors);
    let headlines = ["Pew pew pew!", "Zwiff!", "Smash-boom!", "OMG! Madam 💋"];
    document.querySelector('.headline').textContent = randmize(headlines);
    </script>
</body>
</html>""" % ["Welcome 💋 Madam &bullet; Local web server"]
